PRAGMA defer_foreign_keys=TRUE;
CREATE TABLE search_queries (
    id TEXT PRIMARY KEY,
    query TEXT NOT NULL,
    result_count INTEGER NOT NULL DEFAULT 0,
    timestamp TEXT NOT NULL,
    user_agent TEXT,
    url TEXT,
    ip TEXT,
    created_at DATETIME DEFAULT CURRENT_TIMESTAMP
);
CREATE TABLE leads (
    id TEXT PRIMARY KEY,
    vehicle_id TEXT NOT NULL,
    vehicle_make TEXT NOT NULL,
    vehicle_model TEXT NOT NULL,
    vehicle_year INTEGER NOT NULL,
    vehicle_price REAL NOT NULL,
    customer_name TEXT NOT NULL,
    customer_email TEXT NOT NULL,
    customer_phone TEXT NOT NULL,
    message TEXT,
    inquiry_type TEXT NOT NULL,
    preferred_contact TEXT NOT NULL,
    lead_score INTEGER NOT NULL DEFAULT 0,
    status TEXT NOT NULL DEFAULT 'new',
    source TEXT NOT NULL DEFAULT 'website',
    timestamp TEXT NOT NULL,
    user_agent TEXT,
    url TEXT,
    ip TEXT,
    assigned_to TEXT,
    follow_up_date TEXT,
    notes TEXT,
    created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
    updated_at DATETIME DEFAULT CURRENT_TIMESTAMP
);
CREATE TABLE vehicles (id INTEGER PRIMARY KEY AUTOINCREMENT, make TEXT NOT NULL, model TEXT NOT NULL, year INTEGER NOT NULL, price REAL NOT NULL, odometer INTEGER NOT NULL, bodyType TEXT NOT NULL, color TEXT NOT NULL, description TEXT, images TEXT, isSold INTEGER DEFAULT 0, stockNumber TEXT, vin TEXT, createdAt DATETIME DEFAULT CURRENT_TIMESTAMP, updatedAt DATETIME DEFAULT CURRENT_TIMESTAMP, soldDate TEXT, vendor_id VARCHAR(50) DEFAULT 'internal', vendor_name VARCHAR(100) DEFAULT 'Internal Inventory', vendor_stock_number VARCHAR(100), last_seen_from_vendor TIMESTAMP, vendor_status VARCHAR(50) DEFAULT 'active', sync_status VARCHAR(50) DEFAULT 'synced', is_published INTEGER DEFAULT 1, fuelType TEXT, transmission TEXT, drivetrain TEXT, created_at TEXT, engineSize TEXT, cylinders INTEGER, sold_date TEXT, listing_status TEXT DEFAULT 'published', sold_at TEXT, price_markup_type TEXT DEFAULT 'none', price_markup_value REAL DEFAULT 0, display_price REAL);
CREATE TABLE sessions (
  id TEXT PRIMARY KEY,
  staff_id TEXT NOT NULL,
  token TEXT UNIQUE NOT NULL,
  expires_at DATETIME NOT NULL,
  ip_address TEXT,
  user_agent TEXT,
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  FOREIGN KEY (staff_id) REFERENCES staff(id) ON DELETE CASCADE
);
CREATE TABLE password_resets (
  id TEXT PRIMARY KEY,
  staff_id TEXT NOT NULL,
  token TEXT UNIQUE NOT NULL,
  expires_at DATETIME NOT NULL,
  used INTEGER DEFAULT 0,
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  FOREIGN KEY (staff_id) REFERENCES staff(id) ON DELETE CASCADE
);
CREATE TABLE activity_log (
  id TEXT PRIMARY KEY,
  staff_id TEXT NOT NULL,
  action TEXT NOT NULL,
  entity_type TEXT,
  entity_id TEXT,
  details TEXT,
  ip_address TEXT,
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  FOREIGN KEY (staff_id) REFERENCES staff(id) ON DELETE CASCADE
);
CREATE TABLE vendors (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  vendor_id VARCHAR(50) UNIQUE NOT NULL,
  vendor_name VARCHAR(100) NOT NULL,
  vendor_type VARCHAR(50),
  api_endpoint TEXT,
  scraper_url TEXT,
  sync_frequency VARCHAR(50) DEFAULT 'daily',
  last_sync TIMESTAMP,
  is_active INTEGER DEFAULT 1,
  settings TEXT,
  auto_remove_after_days INTEGER DEFAULT 7,
  grace_period_days INTEGER DEFAULT 3,
  auto_publish INTEGER DEFAULT 1,
  created_at TIMESTAMP,
  updated_at TIMESTAMP
);
CREATE TABLE vendor_sync_logs (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  vendor_id VARCHAR(50),
  vendor_name VARCHAR(100),
  sync_date TIMESTAMP,
  vehicles_found INTEGER DEFAULT 0,
  new_vehicles INTEGER DEFAULT 0,
  updated_vehicles INTEGER DEFAULT 0,
  removed_vehicles INTEGER DEFAULT 0,
  unlisted_vehicles INTEGER DEFAULT 0,
  status VARCHAR(50),
  error_message TEXT,
  sync_duration_seconds INTEGER
);
CREATE TABLE reviews (id TEXT PRIMARY KEY, customer_name TEXT NOT NULL, rating INTEGER NOT NULL CHECK(rating >= 1 AND rating <= 5), review_text TEXT NOT NULL, location TEXT, date TEXT NOT NULL, is_featured INTEGER DEFAULT 0, is_approved INTEGER DEFAULT 1, created_at DATETIME DEFAULT CURRENT_TIMESTAMP, updated_at DATETIME DEFAULT CURRENT_TIMESTAMP);
CREATE TABLE site_settings (id INTEGER PRIMARY KEY, settings_json TEXT NOT NULL, updated_at TEXT DEFAULT CURRENT_TIMESTAMP);
CREATE TABLE search_analytics (id TEXT PRIMARY KEY, query TEXT NOT NULL, result_count INTEGER DEFAULT 0, filters_used TEXT, visitor_id TEXT, session_id TEXT, searched_at DATETIME DEFAULT (datetime('now')), clicked_vehicle_id TEXT);
CREATE TABLE vehicle_views (id TEXT PRIMARY KEY, vehicle_id TEXT, visitor_id TEXT, session_id TEXT, referrer TEXT, user_agent TEXT, viewed_at DATETIME DEFAULT CURRENT_TIMESTAMP);
CREATE TABLE call_logs (id TEXT PRIMARY KEY, lead_id TEXT NOT NULL, staff_name TEXT, duration_minutes INTEGER, notes TEXT, outcome TEXT, created_at DATETIME DEFAULT CURRENT_TIMESTAMP);
CREATE TABLE lead_notes (id TEXT PRIMARY KEY, lead_id TEXT NOT NULL, staff_name TEXT, note_text TEXT NOT NULL, note_type TEXT DEFAULT 'note', created_at DATETIME DEFAULT CURRENT_TIMESTAMP);
CREATE TABLE IF NOT EXISTS "staff" (
  id TEXT PRIMARY KEY,
  email TEXT UNIQUE NOT NULL,
  name TEXT NOT NULL,
  password_hash TEXT NOT NULL,
  role TEXT NOT NULL DEFAULT 'staff' CHECK(role IN ('admin', 'manager', 'sales', 'staff', 'dev')),
  phone TEXT,
  is_active INTEGER DEFAULT 1,
  last_login DATETIME,
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  updated_at DATETIME DEFAULT CURRENT_TIMESTAMP
);
CREATE TABLE image_processing_jobs (
  id TEXT PRIMARY KEY,
  vendor_name TEXT NOT NULL,
  status TEXT NOT NULL DEFAULT 'pending', -- pending, processing, completed, failed
  total_vehicles INTEGER NOT NULL DEFAULT 0,
  vehicles_processed INTEGER NOT NULL DEFAULT 0,
  images_uploaded INTEGER NOT NULL DEFAULT 0,
  images_failed INTEGER NOT NULL DEFAULT 0,
  current_vehicle TEXT,
  error_message TEXT,
  started_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  completed_at DATETIME,
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  updated_at DATETIME DEFAULT CURRENT_TIMESTAMP
);
CREATE TABLE vendor_settings (
  vendor_id TEXT PRIMARY KEY,
  vendor_name TEXT NOT NULL,
  markup_type TEXT DEFAULT 'none', -- 'none', 'amount', 'percentage'
  markup_value REAL DEFAULT 0, -- Dollar amount or percentage value
  is_active INTEGER DEFAULT 1,
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  updated_at DATETIME DEFAULT CURRENT_TIMESTAMP
);
CREATE TABLE sync_logs (
              id TEXT PRIMARY KEY,
              vendor_id TEXT NOT NULL,
              vendor_name TEXT NOT NULL,
              status TEXT DEFAULT 'pending',
              start_time DATETIME,
              end_time DATETIME,
              total_vehicles INTEGER DEFAULT 0,
              new_vehicles INTEGER DEFAULT 0,
              updated_vehicles INTEGER DEFAULT 0,
              removed_vehicles INTEGER DEFAULT 0,
              error_count INTEGER DEFAULT 0,
              message TEXT,
              created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
              updated_at DATETIME DEFAULT CURRENT_TIMESTAMP
            );
CREATE TABLE clients (
  id TEXT PRIMARY KEY,
  first_name TEXT NOT NULL,
  last_name TEXT NOT NULL,
  email TEXT NOT NULL,
  phone TEXT,
  address TEXT,
  city TEXT,
  province TEXT,
  postal_code TEXT,
  country TEXT,
  created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
  updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
  notes TEXT,
  status TEXT CHECK(status IN ('lead', 'prospect', 'customer', 'inactive')) DEFAULT 'lead',
  preferred_language TEXT CHECK(preferred_language IN ('en', 'fr', 'es')) DEFAULT 'en'
);
CREATE TABLE client_documents (
  id TEXT PRIMARY KEY,
  client_id TEXT NOT NULL,
  name TEXT NOT NULL,
  type TEXT NOT NULL,
  url TEXT NOT NULL,
  size INTEGER NOT NULL,
  uploaded_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
  category TEXT CHECK(category IN ('id', 'finance', 'insurance', 'contract', 'other')) DEFAULT 'other',
  FOREIGN KEY (client_id) REFERENCES clients(id) ON DELETE CASCADE
);
CREATE TABLE client_activities (
  id TEXT PRIMARY KEY,
  client_id TEXT NOT NULL,
  type TEXT CHECK(type IN ('call', 'email', 'meeting', 'note', 'document', 'other')) NOT NULL,
  title TEXT NOT NULL,
  description TEXT,
  created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
  created_by TEXT NOT NULL,
  status TEXT CHECK(status IN ('planned', 'completed', 'cancelled')) DEFAULT 'planned',
  scheduled_at TIMESTAMP,
  completed_at TIMESTAMP,
  duration INTEGER,
  FOREIGN KEY (client_id) REFERENCES clients(id) ON DELETE CASCADE
);
CREATE TABLE vendor_feeds (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  vendor_id TEXT NOT NULL UNIQUE,
  vendor_name TEXT NOT NULL,
  feed_url TEXT NOT NULL,
  feed_type TEXT DEFAULT 'xml', -- 'xml', 'json', 'csv'
  is_active INTEGER DEFAULT 1,
  sync_frequency TEXT DEFAULT 'manual', -- 'manual', 'hourly', 'daily', 'weekly'
  last_sync_at DATETIME,
  last_sync_status TEXT, -- 'success', 'error', 'pending'
  last_sync_message TEXT,
  last_sync_count INTEGER DEFAULT 0,
  total_syncs INTEGER DEFAULT 0,
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  updated_at DATETIME DEFAULT CURRENT_TIMESTAMP
);
DELETE FROM sqlite_sequence;
CREATE INDEX idx_search_queries_query ON search_queries(query);
CREATE INDEX idx_search_queries_timestamp ON search_queries(timestamp);
CREATE INDEX idx_search_queries_result_count ON search_queries(result_count);
CREATE INDEX idx_leads_vehicle_id ON leads(vehicle_id);
CREATE INDEX idx_leads_status ON leads(status);
CREATE INDEX idx_leads_timestamp ON leads(timestamp);
CREATE INDEX idx_leads_lead_score ON leads(lead_score);
CREATE INDEX idx_leads_assigned_to ON leads(assigned_to);
CREATE INDEX idx_sessions_token ON sessions(token);
CREATE INDEX idx_sessions_expires ON sessions(expires_at);
CREATE INDEX idx_password_resets_token ON password_resets(token);
CREATE INDEX idx_activity_log_staff ON activity_log(staff_id);
CREATE INDEX idx_activity_log_created ON activity_log(created_at);
CREATE INDEX idx_search_analytics_query ON search_analytics(query);
CREATE INDEX idx_vehicle_views_vehicle_id ON vehicle_views(vehicle_id);
CREATE INDEX idx_vehicle_views_viewed_at ON vehicle_views(viewed_at);
CREATE INDEX idx_vehicle_views_visitor_id ON vehicle_views(visitor_id);
CREATE INDEX idx_vehicles_engineSize ON vehicles(engineSize);
CREATE INDEX idx_vehicles_cylinders ON vehicles(cylinders);
CREATE INDEX idx_staff_is_active ON staff(is_active);
CREATE INDEX idx_vehicles_listing_status ON vehicles(listing_status);
CREATE INDEX idx_vehicles_sold_at ON vehicles(sold_at);
CREATE INDEX idx_jobs_vendor ON image_processing_jobs(vendor_name);
CREATE INDEX idx_jobs_status ON image_processing_jobs(status);
CREATE INDEX idx_jobs_created ON image_processing_jobs(created_at DESC);
CREATE INDEX idx_vehicles_display_price ON vehicles(display_price);
CREATE INDEX idx_vehicles_vendor_id ON vehicles(vendor_id);
CREATE INDEX idx_clients_email ON clients(email);
CREATE INDEX idx_clients_status ON clients(status);
CREATE INDEX idx_client_activities_client_id ON client_activities(client_id);
CREATE INDEX idx_client_activities_status ON client_activities(status);
CREATE INDEX idx_client_activities_scheduled_at ON client_activities(scheduled_at);
CREATE INDEX idx_client_documents_client_id ON client_documents(client_id);
CREATE INDEX idx_vendor_feeds_vendor_id ON vendor_feeds(vendor_id);
CREATE INDEX idx_vendor_feeds_is_active ON vendor_feeds(is_active);
